pragma solidity ^0.5.2;
contract FIFA {
    //Majd Abu ghazaleh
    
    struct Voter {                     
        uint weight;
        bool voted;
        bool panel;
        uint8[4] category; //[0]: coach, [1]: journalist , [2]: player, [3]: fan
        uint8 gVote;   //best goalkeeper vote (choice between 1-5)
        uint8 dVote;   //best defender vote (choice between 1-10)
        uint8 mVote;   //best midfielder vote (choice between 1-10)
        uint8 fVote;   //best forward vote (choice between 1-10)
    }   
    
    struct Nominee {                     
        uint coach_votes;
        uint journalist_votes;
        uint player_votes;
        uint fan_votes;
        uint voteCount;
        bool shortlist;
    }    
    
    address coordinator;
    address panelMember;
    mapping(address => Voter) voters;  
    Nominee[] gkNominees;
    Nominee[] defNominees;
    Nominee[] midNominees;
    Nominee[] fwdNominees;

    uint number_of_voters;

    enum Phase {Init, Regs, Shortlist, Vote, Done}  //{0,1,2,3,4}
    Phase public state = Phase.Done; 


    
       //modifiers
    modifier validPhase(Phase reqPhase) 
    { require(state == reqPhase); 
      _; 
    } 
    
    modifier onlyCoordinator() 
     {require(msg.sender == coordinator);
      _;
     }

    modifier onlyPanelMember() 
     {require(msg.sender == panelMember);
      _;
     }
     

    
        
    constructor (uint8 gk,uint8 def,uint8 mid,uint8 fwd) public  {  
        coordinator = msg.sender;
        voters[coordinator].weight = 2;
        
        require (gk  > 3 ); 
        require (def > 3 ); 
        require (mid > 3 ); 
        require (fwd > 3 ); 

        
        gkNominees.length = gk;
        defNominees.length = def;
        midNominees.length = mid;
        fwdNominees.length = fwd;
        state = Phase.Regs;
    }

    
     function changeState(Phase x) onlyCoordinator public {
        
        require (x > state );
       
        state = x;
     }
    
    function register(uint8 category,address voter) public validPhase(Phase.Regs) onlyCoordinator {
       
        require (! voters[voter].voted);
        number_of_voters++;
        
        if(category == 0){              //Coach
            voters[voter].weight = 4;
            voters[voter].category[0] = 1;
        }
        
        else if(category ==1){          //Journalist
            voters[voter].weight = 3;
            voters[voter].category[1] = 1;
        }        
        
        else if(category ==2){          //Player
            voters[voter].weight = 2;
            voters[voter].category[2] = 1;
        }
        
        else{                           //Fan
            voters[voter].weight = 1;
            voters[voter].category[3] = 1;
        }
        
        
    }

   
    function vote(uint8 gk,uint8 def,uint8 mid,uint8 fwd) public validPhase(Phase.Vote)  { //vote restricted to shortlist members 
      
        Voter memory sender = voters[msg.sender];
       // panelMember = msg.sender;
        
        require (!sender.voted);
        require (gkNominees[gk].shortlist==true); 
        require (defNominees[def].shortlist==true);  
        require (midNominees[mid].shortlist==true);  
        require (fwdNominees[fwd].shortlist==true); 
        
        require (gk <  gkNominees.length); 
        require (def <  defNominees.length); 
        require (mid <  midNominees.length); 
        require (fwd <  fwdNominees.length); 

        
        sender.voted = true;
        sender.gVote = gk;   
        sender.dVote = def;  
        sender.mVote = mid;  
        sender.fVote = fwd;  
        
        uint source= sender.weight;
        
        gkNominees[gk].voteCount += sender.weight;
        defNominees[def].voteCount += sender.weight;
        midNominees[mid].voteCount += sender.weight;
        fwdNominees[fwd].voteCount += sender.weight;
        
        
        if(source==4){
            gkNominees[gk].coach_votes++;
            defNominees[def].coach_votes++;
            midNominees[mid].coach_votes++;
            fwdNominees[fwd].coach_votes++;
        }
        
        else if(sender.weight==3){
            gkNominees[gk].journalist_votes++;
            defNominees[def].journalist_votes++;
            midNominees[mid].journalist_votes++;
            fwdNominees[fwd].journalist_votes++;
        }
        else if(sender.weight==2){
            gkNominees[gk].player_votes++;
            defNominees[def].player_votes++;
            midNominees[mid].player_votes++;
            fwdNominees[fwd].player_votes++;
        }
        
        else {
            gkNominees[gk].player_votes++;
            defNominees[def].player_votes++;
            midNominees[mid].player_votes++;
            fwdNominees[fwd].player_votes++;
        }
    }
    
    function voterCount()public view returns(uint i){
        i=number_of_voters;
    }
    


    function reqWinner() public validPhase(Phase.Done) view returns (uint8 winningGK,uint8 winningDef,uint8 winningMid,uint8 winningFwd) {
       
        uint256 winningGkVoteCount = 0;
        uint256 winningDefVoteCount = 0;
        uint256 winningMidVoteCount = 0;
        uint256 winningFwdVoteCount = 0;
        for (uint8 prop = 0; prop < gkNominees.length; prop++) 
            if (gkNominees[prop].voteCount > winningGkVoteCount) {
                winningGkVoteCount = gkNominees[prop].voteCount;
                winningGK = prop;
            }
            
        for (uint8 prop = 0; prop < defNominees.length; prop++) 
            if (defNominees[prop].voteCount > winningDefVoteCount) {
                winningDefVoteCount = defNominees[prop].voteCount;
                winningDef = prop;
            }
            
        for (uint8 prop = 0; prop < midNominees.length; prop++) 
            if (midNominees[prop].voteCount > winningMidVoteCount) {
                winningMidVoteCount = midNominees[prop].voteCount;
                winningMid = prop;
            }
            
        for (uint8 prop = 0; prop < fwdNominees.length; prop++) 
            if (fwdNominees[prop].voteCount > winningFwdVoteCount) {
                winningFwdVoteCount = fwdNominees[prop].voteCount;
                winningFwd = prop;
            }
       assert(winningGkVoteCount>=1);
       assert(winningDefVoteCount>=1);
       assert(winningMidVoteCount>=1);
       assert(winningFwdVoteCount>=1);
    }
    
   
    function pickShortlist()public validPhase(Phase.Shortlist)  {  //shortlist pre_determined by coordinator
        gkNominees[0].shortlist=true;
        gkNominees[1].shortlist=true;
        gkNominees[2].shortlist=true;
       
        defNominees[0].shortlist=true;
        defNominees[1].shortlist=true;
        defNominees[2].shortlist=true;
        
        midNominees[0].shortlist=true;
        midNominees[1].shortlist=true;
        midNominees[2].shortlist=true;
        
        fwdNominees[0].shortlist=true;
        fwdNominees[1].shortlist=true;
        fwdNominees[2].shortlist=true;
        
        state = Phase.Vote;

    }
    


 
  

}
